I don‚Äôt watch many movies at all and the one movie I went to go see at the theatre in a very, very long time was Black Panther. I remember the big hype and the excitement to go and see this movie like it was yesterday. A movie that made our community proud. Our very first black superhero movie.

The one scene that stood out to me the most was.

King T'Chaka : What is wrong, my son?
T'Challa : I am not ready, Baba.
King T'Chaka : Have you not prepared to be king your whole life? Have you not trained and studied, been by my side?
T'Challa : That is not what I am talking about. I am not ready to be without you.
King T'Chaka : A man who has not prepared his children for his own death has failed as a father. Have I ever failed you?
King T'Chaka : Never.

Wow, I could not believe my ears because in most cases death, and, or anything to do with death is often taboo. I have never ever heard of any one, or any parent, preparing their child/children for the unthinkable BUT, what a difference our world would be, if we did.

Being our best self and living to our full potential leaves an amazing legacy to our loved ones to follow. We would be raising more and more superheroes.

One of my favourite quotes is ‚Äú No harm hoping for the best as long as you are prepared for the worst‚Äù.

Life is too short..

Do you have a Will? 
Does your family know your final wishes? 
Pre-planning is an act of love and a way to leave a positive legacy of you to your loved ones during the most difficult time of their life.

Don't wait before it is too late...

Chadwick Boseman, we thank you for being our Superhero on screen and off screen. We thank you for the lessons that you left us. We thank you for being our King and being such an example to our husbands, brothers and children. Most of all we thank you for the amazing legacy you have left for our community.

You will be missed but never ever forgotten.

